input AS (
    SELECT column1 as l,
           row_number() over() as id
      FROM vals
),
compute_legal AS (
    SELECT l,
           id,
           1 as turn
      FROM input

    UNION ALL

    SELECT REPLACE(REPLACE(REPLACE(REPLACE(l, '()', ''), '[]', ''), '{}', ''), '<>', ''),
           id,
           turn+1
      FROM compute_legal
     WHERE REPLACE(REPLACE(REPLACE(REPLACE(l, '()', ''), '[]', ''), '{}', ''), '<>', '')!=l
),
max_turn AS (
    SELECT max(turn) as t,
           id
      FROM compute_legal
  GROUP BY id
),
first_error AS (
    SELECT POSITION(')' in l) as p3,
           POSITION(']' in l) as p57,
           POSITION('}' in l) as p1197,
           POSITION('>' in l) as p25137,
           l,
           c.id
    FROM compute_legal c
    JOIN max_turn m ON c.id=m.id AND c.turn=m.t
),
incomplete_lines AS (
    SELECT l,
           id
      FROM first_error
     WHERE p3=0
       AND p57=0
       AND p1197=0
       AND p25137=0
),
compute_score AS (
    SELECT 0::bigint as score,
           l,
           id
      FROM incomplete_lines

 UNION ALL

    SELECT CASE RIGHT(l, 1)
             WHEN '(' THEN score*5 + 1
             WHEN '[' THEN score*5 + 2
             WHEN '{' THEN score*5 + 3
             WHEN '<' THEN score*5 + 4
           END,
           LEFT(l, length(l)-1),
           id
      FROM compute_score
     WHERE l!=''
),
scores AS (
    SELECT max(score) as s,
           id
      FROM compute_score
  GROUP BY id
),
ordered_scores AS (
    SELECT s,
           id,
           row_number() over(ORDER BY s) as p1,
           row_number() over(ORDER BY s DESC) as p2
      FROM scores
)
SELECT s
  FROM ordered_scores
 WHERE p1=p2
